@coachDW19 The Eucharist (Post 9, for good measure!):

Later, in 1 Corinthians 11:23-30, St. Paul says even more, describing the Last Supper and the Lord’s command there. Then, St. Paul says, “Whoever, therefore, eats the bread or drinks the cup of the Lord in an unworthy manner will be guilty of profaning the body and blood of the Lord.  Let a man examine himself, and so eat of the bread and drink of the cup.  For anyone who eats and drinks without discerning the body eats and drinks judgment upon himself.  That is why many of you are weak and ill, and some have died.”

One final question: how can you profane yourself by eating something that is merely symbolic? Jesus, the Apostles, the early Church Fathers who wrote down their beliefs in the first few centuries of the Church, definitely believed in the Real Presence of Christ in the Holy Eucharist. And you should, too, friend.

